import React from 'react';
import Navbar from '../Navbar';
import Search from '../Search';
import Logo from './logo.png';
import './HeaderStyles.css';
const Header = () => {
  return (
    <header className='header'>
        <div className='logo'>
            <img src={Logo} alt={Logo}/>
        </div>
        <Search />
    </header>
  );
}

export default Header;
